import React, { useEffect, useState } from "react";
import axios from "axios";

export default function Dashboard() {
  const [overview, setOverview] = useState({
    total_products: 0,
    total_orders: 0,
    shipments: 0,
    low_stock: 0
  });

  useEffect(() => {
    axios.get("/dashboard-overview").then((res) => setOverview(res.data));
  }, []);

  return (
    <div>
      <h2>Dashboard Overview</h2>
      <div style={{ display: "flex", gap: "24px" }}>
        <div>
          <h3>{overview.total_products}</h3>
          <p>Total Products</p>
        </div>
        <div>
          <h3>{overview.total_orders}</h3>
          <p>Total Orders</p>
        </div>
        <div>
          <h3>{overview.shipments}</h3>
          <p>Shipments</p>
        </div>
        <div>
          <h3>{overview.low_stock}</h3>
          <p>Low Stock</p>
        </div>
      </div>
    </div>
  );
}
